import logo from './logo.svg';
import './App.css';
import { HomePage } from './HomePage';
import { Apple } from './Apple';

function App() {
  <BrowserRouter>
   <div>
    <Link to='/' style={{
      marginLeft: 5,
    }}>Home</Link>
    <Link to='/apple' style={{
      marginLeft: 5,
    }}>Apple</Link>
  </div>
  <Routes>
    <Route path='/' element={<HomePage />} />
    <Route path='/apple' element={<Apple />} />
  </Routes>
  </BrowserRouter>
}

export default App;
